import React from "react" ;
import ReactDOM from "react-dom" ;
import './index.css' ;
var image1 = "https://picsum.photos/250/300" ;
var image2 = "https://picsum.photos/260/300" ;
var image3 = "https://picsum.photos/270/300" ;
ReactDOM.render(

    <React.Fragment>
        <h1 className = "Heading">
            My Name Is Pratyush
        </h1>
        <img src = {image1}  alt = "Random Images"/>
        <img src = {image2}  alt = "Random Images"/>
        <img src = {image3}  alt = "Random Images"/>
    </React.Fragment>, 
    document.getElementById("root")

);
